import React, { useState } from 'react';
import './CourseDetail.css';

const CourseDetail = ({ course, onGoBack }) => {
  if (!course) return <div>Loading...</div>;

  const {
    name = 'No course name available',
    description = 'No description available',
    topics = [],
    resources = {}
  } = course;

  const {
    courseLink = '',
    youtubeLinks = [],
    materials = []
  } = resources;

  const [watchedVideos, setWatchedVideos] = useState([]);

  // Track watched videos (clicked = watched)
  const handleVideoClick = (index) => {
    if (!watchedVideos.includes(index)) {
      setWatchedVideos(prev => [...prev, index]);
    }
  };

  const allVideosWatched = youtubeLinks.length > 0 && watchedVideos.length === youtubeLinks.length;

  // Extract YouTube embed URL
  const getEmbedUrl = (url) => {
    const videoId = url.split('v=')[1]?.split('&')[0];
    return `https://www.youtube.com/embed/${videoId}`;
  };

  return (
    <div className="course-detail-container">
      <h2 className="course-title">{name}</h2>

      {/* Overview */}
      <div className="section">
        <h3 className="section-title">Overview</h3>
        <p className="section-content">{description}</p>
      </div>

      {/* Key Topics */}
      <div className="section">
        <h3 className="section-title">Key Topics</h3>
        <ul className="topics-list">
          {topics.length > 0 ? (
            topics.map((topic, idx) => <li key={idx}>{topic}</li>)
          ) : (
            <p>No topics available.</p>
          )}
        </ul>
      </div>

      {/* Course Link */}
      <div className="section">
        <h3 className="section-title">Main Course Link</h3>
        {courseLink ? (
          <a href={courseLink} target="_blank" rel="noopener noreferrer" className="resource-link">
            Access Course
          </a>
        ) : (
          <p>No course link available.</p>
        )}
      </div>

      {/* YouTube Videos */}
      <div className="section">
        <h3 className="section-title">Tutorial Videos</h3>
        {youtubeLinks.length > 0 ? (
          <>
            <p className="info-note">
              Please watch all {youtubeLinks.length} videos before proceeding.
            </p>
            <div className="video-grid">
              {youtubeLinks.map((link, index) => (
                <div key={index} className="video-item" onClick={() => handleVideoClick(index)}>
                  <iframe
                    width="100%"
                    height="250"
                    src={getEmbedUrl(link)}
                    title={`YouTube Video ${index + 1}`}
                    frameBorder="0"
                    allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                    allowFullScreen
                  ></iframe>
                  <p className="video-label">Video {index + 1}</p>
                </div>
              ))}
            </div>
          </>
        ) : (
          <p>No tutorial videos available.</p>
        )}
      </div>

      {/* Additional Materials */}
      <div className="section">
        <h3 className="section-title">Materials</h3>
        {materials.length > 0 ? (
          <ul className="materials-list">
            {materials.map((m, i) => <li key={i}>{m}</li>)}
          </ul>
        ) : (
          <p>No additional materials available.</p>
        )}
      </div>

      {/* Back Button */}
      <button
        onClick={onGoBack}
        className={`back-button ${!allVideosWatched ? 'disabled' : ''}`}
        disabled={!allVideosWatched}
      >
        Back
      </button>
    </div>
  );
};

export default CourseDetail;
